    console.log(meusPokemon);
    return(

        <>
        <h1>Meus Pokemon</h1>
        <div className="grid-container">
          
          {meusPokemon.map((pokemon,i)=>{
          
            return  <Card key={i} pokemon={pokemon}/>
        
              
          })}

        </div>
        </>
        
    )
}
